export const UPDATE_STEPCOUNT = "UPDATE_STEPCOUNT";

export const UPDATE_HISTORY = "UPDATE_HISTORY";

export const UPDATE_SQUARE = "UPDATE_SQUARE";

export const changeStepCount = (UPDATE_STEPCOUNT) => {
  return {
    type: UPDATE_STEPCOUNT,
  };
};

export const changeHistory = (UPDATE_HISTORY) => {
  return {
    type: UPDATE_HISTORY,
  };
};

export const changeSquare = (UPDATE_SQUARE) => {
  return {
    type: UPDATE_SQUARE,
  };
};
